{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/kristinakang/case-study-1-cyclistic?scriptVersionId=160691660\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"7d72bf7b","metadata":{"execution":{"iopub.execute_input":"2024-01-25T21:31:25.435002Z","iopub.status.busy":"2024-01-25T21:31:25.434276Z","iopub.status.idle":"2024-01-25T21:31:25.459819Z","shell.execute_reply":"2024-01-25T21:31:25.458415Z","shell.execute_reply.started":"2024-01-25T21:31:25.434965Z"},"papermill":{"duration":0.00607,"end_time":"2024-01-28T04:40:25.387199","exception":false,"start_time":"2024-01-28T04:40:25.381129","status":"completed"},"tags":[]},"source":["# Cyclistic\n","\n","This is data analysis for _Cyclistic_, a bike-share company, in order to help them attract more riders while following the steps of the data analysis process: **Ask**, **Prepare**, **Process**, **Analyze**, **Share** and **Act**. \n","\n","The *goal* of the analysis is <ins>to maximize the number of annual memberships</ins>. The analysis will be useful when designing marketing strategies aimed at converting casual riders into annual members. \n","\n","The *question* assigned is <ins>how do casual riders and annual members use Cyclistic bikes differently?</ins>. The Cyclistic historical bike trip data is used to identify the trend."]},{"cell_type":"markdown","id":"067e83a4","metadata":{"papermill":{"duration":0.005065,"end_time":"2024-01-28T04:40:25.39814","exception":false,"start_time":"2024-01-28T04:40:25.393075","status":"completed"},"tags":[]},"source":["## Scope of Work\n","| Phase | Key Tasks | Deliverable |\n","| ----------- | ----------- | ----------- |\n","| Ask | <ul><li>Identify the business task</li><li>Consider key stakeholders</li></ul> | A clear statement of the business task |\n","| Prepare | <ul><li>Download data and store it appropriately</li><li>Identify how it’s organized</li><li>Sort and filter the data</li><li>Determine the credibility of the data</li></ul> | A description of all data sources used |\n","| Process | <ul><li>Check the data for errors</li><li>Choose tools used</li><li>Transform the data</li><li>Document the cleaning process</li></ul> | Documentation of any cleaning or manipulation of data |\n","| Analyze | <ul><li>Aggregate the data so it’s useful and accessible</li><li>Organize and format the data</li><li>Perform calculations</li><li>Identify trends and relationships</li></ul> | A summary of the analysis |\n","| Share | <ul><li>Determine the best way to share the findings</li><li>Create effective data visualizations</li><li>Present your findings</li><li>Ensure the work is accessible</li></ul> | Supporting visualizations and key findings |\n","| Act | <ul><li>Finalize the conclusion</li><li>Think of ways to incorporate the insights into business decisions</li></ul> |  Top three recommendations based on the analysis |"]},{"cell_type":"markdown","id":"e1fe70b4","metadata":{"papermill":{"duration":0.004875,"end_time":"2024-01-28T04:40:25.408063","exception":false,"start_time":"2024-01-28T04:40:25.403188","status":"completed"},"tags":[]},"source":["## Business Background\n","Cyclistic: a bike-share programs with 5,824 bikes and 692 docking stations\n","- about 8% of riders use assistive bikes\n","- about 30% use the bokes to commute to work each day\n","- pricing plans:\n","    - casual riders\n","        - single-ride\n","        - full-day pass\n","    - Cyclistic members\n","        - annual membership\n","\n","Lily Moreno: the directer of marketing and your manager.\n","- responsible for the development of campaigns and initiatives to promote Cyslistic\n","- including email, social media, etc\n","\n","Cyclistsic marketing analytics team: a team of data analysts responsible for collecting, analyzing, and reporting data.\n","\n","Cyclistic executive team: decide whether to approve the recced marketing program.\n","\n","### Business task\n","How do annual members and casual riders use Cyclistic bikes differently?"]},{"cell_type":"markdown","id":"cf36087b","metadata":{"papermill":{"duration":0.004968,"end_time":"2024-01-28T04:40:25.418053","exception":false,"start_time":"2024-01-28T04:40:25.413085","status":"completed"},"tags":[]},"source":["## Sources of Data\n","I have used data from January 2023 to December 2023 to ensure reliability and credibility of the [data](https://divvy-tripdata.s3.amazonaws.com/index.html). The data has been made available by Motivate International Inc. under this [license](https://divvybikes.com/data-license-agreement)."]},{"cell_type":"markdown","id":"74b4e89c","metadata":{"papermill":{"duration":0.004947,"end_time":"2024-01-28T04:40:25.428015","exception":false,"start_time":"2024-01-28T04:40:25.423068","status":"completed"},"tags":[]},"source":["## Cleaning Data\n","\n","### Preparing for manipulation of data"]},{"cell_type":"code","execution_count":1,"id":"ab2609cd","metadata":{"_kg_hide-input":true,"_kg_hide-output":true,"execution":{"iopub.execute_input":"2024-01-28T04:40:25.443448Z","iopub.status.busy":"2024-01-28T04:40:25.440577Z","iopub.status.idle":"2024-01-28T04:42:05.994234Z","shell.execute_reply":"2024-01-28T04:42:05.992271Z"},"papermill":{"duration":100.570003,"end_time":"2024-01-28T04:42:06.002958","exception":false,"start_time":"2024-01-28T04:40:25.432955","status":"completed"},"scrolled":true,"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\n","Attaching package: ‘dplyr’\n","\n","\n","The following objects are masked from ‘package:stats’:\n","\n","    filter, lag\n","\n","\n","The following objects are masked from ‘package:base’:\n","\n","    intersect, setdiff, setequal, union\n","\n","\n","\n","Attaching package: ‘janitor’\n","\n","\n","The following objects are masked from ‘package:stats’:\n","\n","    chisq.test, fisher.test\n","\n","\n"]},{"name":"stdout","output_type":