ipulating Data"]},{"cell_type":"code","execution_count":3,"id":"c4d5bf88","metadata":{"execution":{"iopub.execute_input":"2024-01-28T04:42:33.270339Z","iopub.status.busy":"2024-01-28T04:42:33.26871Z","iopub.status.idle":"2024-01-28T04:43:16.414069Z","shell.execute_reply":"2024-01-28T04:43:16.411596Z"},"papermill":{"duration":43.157163,"end_time":"2024-01-28T04:43:16.417248","exception":false,"start_time":"2024-01-28T04:42:33.260085","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["[1] \"Unnecessary columns deleted successfully.\"\n"]},{"data":{"text/html":["'There are [1] 6990 null values in \\'end_lat\\''"],"text/latex":["'There are {[}1{]} 6990 null values in \\textbackslash{}'end\\_lat\\textbackslash{}''"],"text/markdown":["'There are [1] 6990 null values in \\'end_lat\\''"],"text/plain":["[1] \"There are [1] 6990 null values in 'end_lat'\""]},"metadata":{},"output_type":"display_data"},{"data":{"text/html":["'There are [1] 6990 null values in \\'end_lng\\''"],"text/latex":["'There are {[}1{]} 6990 null values in \\textbackslash{}'end\\_lng\\textbackslash{}''"],"text/markdown":["'There are [1] 6990 null values in \\'end_lng\\''"],"text/plain":["[1] \"There are [1] 6990 null values in 'end_lng'\""]},"metadata":{},"output_type":"display_data"},{"name":"stdout","output_type":"stream","text":["[1] \"Data frame refined by deleting null values.\"\n","[1] \"Converted 'started_at' and 'ended_at' to the datetime type.\"\n","[1] \"Created new columns 'date', 'month', 'day' and 'day_of_week' out of 'started_at'.\"\n","[1] \"Calculated ride_length for each ride.\"\n","[1] \"Successfully deleted negative ride duration.\"\n"]}],"source":["# delete 'start_station_name', 'start_station_id', 'end_station_name' and 'end_station_id'\n","# since they won't be necessary for our purposes\n","#trips2023 <- subset(trips2023, select = -c(start_station_name, start_station_id, end_station_name, end_station_id))\n","print('Unnecessary columns deleted successfully.')\n","\n","# delete null values\n","null_val_one <- capture.output(sum(is.na(trips2023$end_lat)))\n","sprintf(\"There are %s null values in 'end_lat'\", null_val_one)\n","null_val_two <- capture.output(sum(is.na(trips2023$end_lng)))\n","sprintf(\"There are %s null values in 'end_lng'\", null_val_two)\n","trips2023 <- trips2023[!(is.na(trips2023$end_lat) | is.na(trips2023$end_lng)), ]\n","print('Data frame refined by deleting null values.')\n","\n","# divide datetime column\n","trips2023$started_at = strptime(trips2023$started_at, \"%Y-%m-%d %H:%M:%S\")\n","trips2023$ended_at = strptime(trips2023$ended_at, \"%Y-%m-%d %H:%M:%S\")\n","print(\"Converted 'started_at' and 'ended_at' to the datetime type.\")\n","trips2023$date <- as.Date(trips2023$started_at)\n","trips2023$month <- format(as.Date(trips2023$date), \"%m\")\n","trips2023$day <- format(as.Date(trips2023$date), \"%d\")\n","trips2023$day_of_week <- format(as.Date(trips2023$date), \"%A\")\n","print(\"Created new columns 'date', 'month', 'day' and 'day_of_week' out of 'started_at'.\")\n","trips2023$ride_length <- difftime(trips2023$ended_at, trips2023$started_at)\n","print('Calculated ride_length for each ride.')\n","\n","# delete negative ride length\n","trips2023 <- trips2023 %>% \n","  filter(ride_length > 0)\n","print('Successfully deleted negative ride duration.')"]},{"cell_type":"markdown","id":"8bd4ee37","metadata":{"papermill":{"duration":0.00735,"end_time":"2024-01-28T04:43:16.433213","exception":false,"start_time":"2024-01-28T04:43:16.425863","status":"completed"},"tags":[]},"source":["# Analyzing data"]},{"cell_type":"code","execution_count":4,"id":"f53bc29b","metadata":{"execution":{"iopub.execute_input":"2024-01-28T04:43:16.452152Z","iopub.status.busy":"2024-01-28T04:43:16.450487Z","iopub.status.idle":"2024-01-28T04:43:32.874557Z","shell.execute_reply":"2024-01-28T04:43:32.871206Z"},"papermill":{"duration":16.437342,"end_time":"2024-01-28T04:43:32.877916","exception":false,"start_tim